import React, { Component } from 'react';
import axios from 'axios';

class Main extends Component {
  constructor() {
    super()
    this.state = {
      error: null,
      isLoaded: false, 
      items: []
    }
  }

  componentDidMount() {
    fetch('http://www.omdbapi.com/?apikey=4c702575&?t=batman&plot=full')
    .then((response) => response.json())
      .then((response) => {
        this.setState({
          isLoaded: true,
          items: response
        });
      },
      (error) => {
        this.setState({
          isLoaded: true,
          error
        });
      })
  }
  render() {
    const { error, isLoaded, items } = this.state;
    return (
      <div>
        {console.log(this.state)}
        <h1>{error}</h1>
        <h1>{isLoaded}</h1>
        <h1>{items}</h1>
      </div>
    )
  }
}

export default Main;
